        ["Unavailable"] = true,
        ["ShortDescription"] = [[Earn this by completing 3 Royale Bingo rows (Series 1) OR by redeeming your code from the Valkyrie Doll to obtain this item, plus the rest of the Valkyrie set! ~Tradable!~ 
A shimmering set of shining shoes meant to be worn as part of a valkyrie’s uniform, chiseled by the deft hands of the women sworn to protect our realms. With straps fitting gracefully around the legs, they provide both support and a touch of sophistication, ensuring that their wearer moves with both grace and confidence; for the tall set of heels must ensure that her head is literally held high. The wearer is granted full control with the endless array of toggles, for they may be worn shined or unshined, with straps or without, even the ruffles of the shorts may be toggled on or off!

(A Small Spark, Chapter 7 — Shimmering Shoes) For how Valkyrie Lumina's eyes narrow as the day slips by her within the clouds, her hands in fists in front of her, sure and steady. But then, before her... She notes the way the pink of the sunset spills across the horizon... For now this causes her lashes to blink, lip in a jagged line. For she knows now that there is little time. A true guardian of realms must find the way to the hallowed halls before sundown, lest she fail her test... Suddenly, little Lumina hears a whining far beneath her. Frowning in confusion, she slides through a cloud to see the ground below... Her steed — no, her friend! He has been cornered, chased to a cliffside by some strange, glimmering golden lion illusions! Valkyrie Lumina looks ahead... At the sinking sunset of the horizon. Her heart surges. Her big blue eyes brim with tears. For a moment, Lumina feels little again...

Then her gaze peers downwards. To her four-legged companion. To the hoofed stallion of ages who had bucked her from his back countless times and left her in the dirt...

Lumina follows her heart; she could not abandon someone in need! Eyebrows creasing, she sniffles goodbye to her dreams, as she descends in a furious burst of air. For though the skies darken to twilight, her soul is ever steady. Ever sure of itself in her decision. Even amidst the growing pressure. In a tectonic boom, the impact of her divine footwear causes the grass to billow... Unsheathing her blade, she charges the beasts... They burst into golden dust, vanishing.

Slowly approaching the stallion, he cautiously sniffs at her, still hesitant... She looks down, not wanting the ancient guardian’s steed to see her cry… For she has saved him, but in doing so, failed her final test. However, as she wipes away her tears with her forearm, she knows in her heart that she does not regret her choice. For someone in need would always be worth more than her exam…

“Valkyrie Lumina.”

His voice echoes through her mind, as if by psychic. She looks up in awe — he can talk?!

“Only a true guardian would abandon all she had been preparing for, to save one in need, even one who had been as purposefully stubborn as I.”
His wise voice, outside the realm of time, sounds across the plains... Her breath hitches.
“This was all your true test. You have passed, Valkyrie Lumina. With flying colors. I welcome you now as my rider... Oh protector of the realms.”
With this, Valkyrie Lumina tearfully embraces her newfound friend... Finding that having the strength to let yourself cry, may indeed be the most noble of them all.

For Lady Valkyrie Lumina, the guardian of our hearts, finding the strength to help others even before herself. For the protector of realms, who found the wings to fly, but only found true strength within herself by finding her footing firmly on the ground. Her helm glistening, cape and skirt swaying, & her shield and blade raised. <3]],
