(Tale of Triumph, Part 2)

 In the days that follow a group of farmers marched upon the castle. They ignored the lingering eyes of the street vendors. Today was not usually the day they sell their crops, so it was an unusual sight to behold. To the farmers surprise, they were met with little resistance from the knights after stating their reasoning for an audience with the king. As they proceeded, the knights tailed hesitantly behind them, giving each other concerned glances. The farmers murmured to themselves, perhaps they weren't the only ones worried.

The king looked up from his book after hearing a knock at his chamber door. Granting whoever was outside entry, he straightened himself in his chair beside the fire. His eyes widened as he witnessed a gaggle of dirt-coated farmers stomp into the room. Anxiously, glanced towards the group of knights, who stood in parallel lines in the chamber doorway, but they stared expectantly back at him at him. Peering outside, he could see curious servants poking their heads around the door, before they quickly shot back upon meeting his gaze. Hushed whispers echoed through the room until...
The apparent leader of the farmers threw a sack at his ruler's feet, causing the king to jolt. 
"What... Is the meaning of this?" 
He asked breathlessly.
The same farmer hooked his thumbs into the straps of his overalls and said,
"Well, your highness. We thought you should take a look at what's going on."
Brow creasing, the king squinted.
"I'm afraid I don't understand"
The farmer shrugs, wringing his hat,
"All our crops have gone bad. Take a look for yourself if you don't believe me!"
Another farmer suddenly chimed in,
"My orchard is withering, it ain't bearing any fruit, & it's in season!"
And another,
"The grass is dyin'... It ain't ever done this before. It ain't just me either; it's happenin' to all of us!"
Then a knight suddenly spoke,
"The gardeners, sire, if I may, have been saying that the flowers are dying."
Blinking, the king shook his head in disbelief at this onslaught of new information.
"How long has this been happening?"
A servant hiding behind the wooden door bravely spoke up.
"Se... Several days, maybe, nearly a week... Well... Uhm... I don't know..."
Eyebrows furrowing, the king's hands clenched into fists.
"Why was I not informed about this?"
He demanded, leaning down to open the sack beneath his feet. It once contained vegetables, but now only a pile of pale ashes. 
The servant met the gaze of several occupants of the room. They craned their head down
."We... We just didn't think it worth mentioning.... It was so small & then, suddenly, it was a growing problem..."
the king solemnly shook his head in disbelief. (written by stixxntricks)]],
