        ["Unavailable"] = true,
        ["ShortDescription"] = [[(December's Dream, Chapter 8, End) The two shuffled towards the shop, the more masculine individual trailed behind, reluctant & slow. As the melody from her memories came into earshot once again, December stood straight & poised on the street sprinkled in cold stardust. Placing his groceries on a bench beside them, the man quirked up an eyebrow at her actions while she purposefully disregarded him, assembling herself in the only way she knew how; by continuing in her stretches alone. An icy wind pushed past her form, but she did not permit herself to shiver, lest she loses her focus while she prepares. Fortunately for her, not only did her outerwear provide protection against the chill, but her button-up shorts & insulated tights certainly assisted. They did their job too well, she found herself not wanting to stray from the familiar warmth of her wintery yet flexible dancers clothing because of it, her wardrobe also containing a pair without a pattern. Opening her eyes, at last, she stared at the fellow who awkwardly stood at the sidelines, hands in his coat pockets.
'Right, come here.'
The words seemed to take him by surprise even though he was already blankly observing her.
'Uh, I must warn you, I have two left feet.'
With an irritated puff, she let her posture deflate, & she advanced towards him.
'I can teach you, here, follow me.'
Outstretching her hand, he sighed, before taking it. Hesitantly, he mirrored her movements. Clunky & stiff, this man was no dancer, but she noted how everybody must start somewhere. She was probably not too dissimilar while up on stage. Once a well-oiled machine gets too used to a routine it'd be rigid in any other action after some time. Looking down at the thought, she almost pouted at that realization. Under the full moon's light, when was the last time she danced for herself?
It glided through her mind that only a few more moments would remain of this starless symphony, then she would head home, & her cycle would pirouette once again. The other stared at his feet as they stepped methodically around each other, the sturdy curve of her heels contrasted to his curtly heeled boots, unable to feel the cold thanks to his lined trousers, kept up by a practical belt. She mirrored, watching his shoes, which just made him more anxious. He was as unsure as a newborn hooved beast in his gestures. Perhaps that was a good thing. Perhaps in another life, he'd pursue a career in refining his footwork, & she'd be his teacher, guiding him literally every step of the way.
'Geez, for me to cause someone as frosty as you to crack into a smile, I must be pretty bad, huh?'
Scowling, her eyes narrowed at his words.
'Frosty? Excuse you, sir! I was about to say you're not awful at this. Perhaps I shan't now!'
Looking away before she heard a tired laugh leave his lips, she quickly turned back. Somehow, he didn't look so exhausted now, despite dancing in the street in the bitter cold.

As snowflakes kept descending, the pair became in tune with the other's motions, together, they swayed in symmetry. The passersby didn't even spare them a second glance, & if any did, they were too busy fussing over themselves to care. That was the creed of the city, but perhaps it was also the epitome of its upsides. December closed her eyes, keeping the harmony in her head. It'd soon be submerged in the storm of the city, but for now, it'd also be composed into her muscle memory. The cool mould that allowed for their sculpted snow-prints would eventually melt into the metropolis, but this magical moment would be spun methodically into her mind as December's dream manoeuvred into a revitalised reality. (written by stixxntricks)]],
